import React from 'react';
import {users} from '../data';


export default function tableHeader(users) {
    return (
        <table>
            <tbody>
                <tr>
                    <td> ID: {this.props.value[0].table}</td>
                </tr>
                {this.props.value.map((users, index) => {
                        return (
                            <tr key={this.props.id + index.toString()}>
                                <td>{users.id}</td>
                            </tr>
                        )
                    }
                )}
            </tbody>
        </table>
    )
}
